import React from 'react';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      nr: '',
    };
    this.submit = this.submit.bind(this);
  }

  cui(newCui){
    this.setState({nr:newCui})
  }

  submit(){
    alert(this.state.nr)
  }

  render(){
    console.log(this.state.nr)
  return (
        <div style={{margin:40}}>
          <form onSubmit={this.submit}>
            <label>
              CUI:
              <input type="text" value={this.state.nr} maxLength={9} onChange={this.cui.bind(this, this.state.nr)}/>
            </label>
            <input type="submit" value="Submit"  />
          </form>
        </div>
  );
}
}

export default App;
